import { StyleSheet, css } from 'aphrodite';

const Text = ({fontWeight = 600, text , color, size}) => {
    const style = StyleSheet.create(
        {
        "font-family": "Gilroy",
        "font-weight": fontWeight,
        "color": color,
        "font-size": size,}
    );
    return (
        <span style={style} onClick={()=> console.log("Asdsad")}>
            {text}
        </span>
    );
};

export default Text;
